import 'bootstrap/dist/css/bootstrap.min.css';
import {ButtonGroup, DropdownButton, Dropdown, Button} from 'react-bootstrap';

const LowerBar=()=>{
    return(
        <ButtonGroup className='buttonGroup' aria-label="Basic example" style={{weight: "100%", height:"7vh"}} >
            <DropdownButton
                className='choiceTime'
                as={ButtonGroup}
                key="up"
                id={`dropdown-button-drop-up`}
                drop="up"
                variant="secondary"
                title={` 시간대 선택 `}
            >
                <div style = {{height: '300px', overflow: "auto", textAlign: "center"}}>
                    <Dropdown.Item eventKey="-1">전 체</Dropdown.Item>
                    {reTime()}
                </div>
            </DropdownButton>
            <Button className='makeRoom' variant="secondary" size="lg">
            방 만들기
            </Button>
        </ButtonGroup>
    )
}

function Time_Line(porps){
    return(
      <>
        <Dropdown.Divider />
        <Dropdown.Item eventKey={porps.chTime}>
          {porps.chTime + '시 ~ ' + (porps.chTime + 1) + '시'}
        </Dropdown.Item>
      </>
    )
}

function reTime(){
    var newArray = [];
    for(var i = 0; i < 24; i++)
    {
      newArray.push(<Time_Line chTime = {i}></Time_Line>)
    }
    return newArray;
  }

export default LowerBar;
